    [],nt"revision_timestamp": "2016-07-27T23:01:42.689134",nt"name": "results-of-aerial-surveys-of-migratory-birds-on-npr-a-in-1977-and-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the results of aerial
    surveys flown in 1977 and1978 on the National Petroleum Reserve in Alaska (NPR-A)
    to determine densities and distributions of migratory birds. The objectives of this
    study were to: (1) Estimate populations of all species or groups of species of birds
    represented within the NPR-A; (2) Designate critical habitats essential for primary
    life processes (i.e., staging, breeding, brood rearing, molting, migration, etc.);
    (3) Determine densities and distributions of birds at selected times of the year;
    (4) Identify methods of comparing ground to aerial bird counts for more accurate
    estimates of migratory bird populations.",nt"license_title": "License Not
